import './SwipeItem.css';

function SwipeItem({key, background, title, button}) {
    <div id={key} className='swipe-item'>
        <img className="swiper-image" src={background}>
        </img>
        <div>
            {title}
        </div>
        <button>
            {button}
        </button>
    </div>
};

export default SwipeItem;
